import React, { Fragment } from "react";

const SideBox = () => {
  return (
    <div>
      <div className="sidebox-container">
        <div className="name-container">
          <h1>
            Dimitri
            <br />
            Michel
            <br />
            <strong>Pierre-Louis</strong>
          </h1>
        </div>
      </div>
    </div>
  );
};

export default SideBox;
